class PokenomGame:
    def __init__(self, n):
        self.n = n
        self.boxes = [0] * n

    def add_stone(self, u, v):
        for i in range(u-1, v):
            self.boxes[i] += 1

    def calculate_expected_value(self):
        A = sum(i**2 for i in self.boxes)
        B = self.n * (self.n + 1) // 2
        return A * B**-1 % (10**9 + 7)

